Secret chats are accepted or refused automatically, based on a value in the settings (by default MadelineProto is set to accept all secret chats).
Before sending any message, you must check if the secret chat was accepted by the other client with the following method:
$status is 0 if the chat cannot be found in the local database, 1 if the chat was requested but not yet accepted, and 2 if it is a secret chat.
If the status is 0, the message is sent to the client. If the status is 1, the client is not yet accepted, and the message is sent to the server. If the status is 2, the client is already accepted, and the message is sent to the server.
